import './styles/content.css';
var React = require('react');

var createMatrix = () => {
  let tiles = [];
  for(var i = 0; i < 3; i++) {
    tiles.push(<div key={i}></div>)
  }
  return tiles;
}

var Content = () => {
  return(
    <div className='contentContainer'>
      <div className='gameBox'>
      {
        createMatrix()
      }
      </div>
    </div>
  )
}

export default Content;
